/* En Solidity, puedes definir una interfaz que acte como un contrato 
    "virtual" definiendo los mtodos que deben ser implementados por un contrato 
    que cumpla con esta interfaz. 
    En este caso, estamos definiendo una interfaz KittyInterface que tiene un 
    mtodo getKitty que devuelve varios valores de un gato de CryptoKitties. 
    No necesitamos definir la lgica de este mtodo aqu, solo necesitamos 
    definir la firma de la funcin (es decir, el nombre de la funcin y los 
    tipos de argumentos que toma y devuelve).
*/

/* En solidity <0.6 no se necesita abstract ni virtual */

abstract contract KittyInterface { 
  function getKitty(uint256 _id) external view virtual returns (
    bool isGestating,
    bool isReady,
    uint256 cooldownIndex,
    uint256 nextActionAt,
    uint256 siringWithId,
    uint256 birthTime,
    uint256 matronId,
    uint256 sireId,
    uint256 generation,
    uint256 genes
  );
}



/*  Storage se refiere a las variables guardadas permanentemente
    en la blockchain. Las variables de tipo memory son temporales, 
    y son borradas en lo que una funcin externa llama a tu contrato. 
    Piensa que es como el disco duro vs la RAM de tu ordenador.
*/

/*  Las variables de estado (variables declaradas fuera de las funciones) 
    son por defecto del tipo storage y son guardadas permanentemente en
    la blockchain, mientras que las variables declaradas dentro de las funciones
    son por defecto del tipo memory y desaparecern una vez la llamada a la 
    funcin haya terminado.
*/


contract ZombieFeeding is ZombieFactory {

    // no es buena practica setear el ckAddress en el contrato por si este cambia en el futuro
    // por eso se crea la funcion setKittyContractAddress
    // address ckAddress = 0x06012c8cf97BEaD5deAe237070F9587f8E7A266d; // Inicializa kittyContract aqu usando el `ckAddress` de arriba

    KittyInterface kittyContract; // = KittyInterface(ckAddress);

    // onlyOwner es un modificador que solo permite que el propietario del contrato ejecute la funcin
    // se hereda de OpenZeppelin_Ownable.sol

    // el codigo de onlyOwner es un modificador, y se ejecutara antes de la funcin a la que se le aplica

    function setKittyContractAddress(address _address) external  onlyOwner {
        kittyContract = KittyInterface(_address);
    }

    /*  en Solidity 0.5.0 y versiones posteriores,
        los parmetros de tipo string, arrays y structs deben especificar
        explcitamente su ubicacin de datos (memory o calldata)
    */

    /*  Alimentarse activa el enfriamiento del zombi, 
        y solo el propietario del zombi puede alimentarlo. 
        Los zombis no podrn alimentarse de gatitos hasta que su 
        periodo de enfriamiento haya concluido
    */

    /*  Si nos damos cuenta, esta funcin solo necesita ser llamada por feedOnKitty(),
        as que la manera ms fcil de prevenir estos problemas es hacer 
        la funcin internal.
    */

    /* ownerOf es un modificador que solo permite que el propietario
       del zombi ejecute la funcin, esta defido al final del contrato 
    */

    function feedAndMultiply(uint _zombieId, uint _targetDna, string memory _species) internal onlyOwnerOf(_zombieId){
        // no es necesatio esto porque se usa el modifier ownerOf
        // require(msg.sender == zombieToOwner[_zombieId]); // solo el dueo del zombi puede llamar a esta funcin

        Zombie storage myZombie = zombies[_zombieId]; // almacenamos el zombi en la memoria

        //  el usuario solo podr ejecutar esta funcin si el enfriamiento del zombi ha terminado.

        require (_isReady(myZombie)); // solo puede alimentarse si est listo   

        _targetDna = _targetDna % dnaModulus; // nos aseguramos de que _targetDna no sea mayor que dnaModulus
        uint newDna = (myZombie.dna + uint(_targetDna)) / 2;


        /*  compara los hashes keccak256 de _species y el string "kitty".
            Dentro de la sentencia if, queremos reemplazar los ltimos 2 dgitos 
            del ADN con 99. Una manera de hacer esto es usando la lgica:
            newDna = newDna - newDna % 100 + 99;.
            Pongamos que newDna es 334455. Entonces newDna % 100 es 55,
            as quenewDna - newDna % 100 es 334400. Finalmente aadimos 99 
            para conseguir 334499.
        */

        if (keccak256(abi.encodePacked(_species)) == keccak256(abi.encodePacked("kitty"))) {
            newDna = newDna - newDna % 100 + 99;
        }

        _createZombie("NoName", newDna);

        _triggerCooldown(myZombie); // activa el enfriamiento del zombi
    }

    /*  Vamos a hacer una funcin que recoga los genes del gato del contrato
        (kittyContract) y los use para crear un nuevo zombi.
    */

    /*  Vamos a hacer que los zombis creados a partir de gatos tengan una 
        nica caracterstica que muestre que son gato-zombis.
        Para hacer esto, debemos aadir algo de cdigo del gato en el ADN del zombi.
        Estamos solo usando los primeros 12 dgitos de los 16 dgitos que determinan
        el ADN de la apariencia de un zombi.
        As que vamos a usar los ltimos 2 dgitos para manejar esas caractersticas
        "especiales". Diremos que los gato-zombis tienen 99 en los ltimos dos dgitos 
        de su ADN (debido a que tienen 9 vidas). Entonces en nuestro cdigo, 
        diremos que si (if) un zombi viene de un gato, los ltimos dos dgitos 
        de su ADN sern 99.
    */

    function feedOnKitty(uint _zombieId, uint _kittyId) public {
        uint kittyDna;
        (,,,,,,,,,kittyDna) = kittyContract.getKitty(_kittyId); // Almacenamos el ADN del gato en kittyDna
        feedAndMultiply(_zombieId, kittyDna, "kitty"); // Creamos un nuevo zombi con el ADN del gato
    }   

    /* Puedes pasar un puntero storage a una estructura 
       como argumento a una funcin private o internal. Esto es prctico, 
       por ejemplo, para pasar entre funciones la estructura de nuestro Zombie.
    */

    function _triggerCooldown(Zombie storage _zombie) internal {
        _zombie.readyTime = uint32(block.timestamp + cooldownTime);
    }   

    function _isReady(Zombie storage _zombie) internal view returns (bool) {
        return (_zombie.readyTime <= block.timestamp);
    }

    /* el modificador ownerOf solo permite
     que el propietario del zombi ejecute la funcin */

    modifier onlyOwnerOf(uint _zombieId) {
    require(msg.sender == zombieToOwner[_zombieId]);
    _;
  }

}
